import React from 'react'

const TotalAmount = () => {
  return (
    <div>
        <h3>TotalAmount</h3>
        <b>$200.99</b>
    </div>
  )
}

export default TotalAmount
const Container = styled('div')`
	display: flex;
	align-items: center;
	justify-content: space-between;
	margin-top: 28px;
	& h3 {
		font-size: 20px;
		font-weight: 700;
		color: #222222;
	}
	& b {
		font-size: 22px;
		font-weight: 600;
		color: #8a2b06;
	}
`
